The Radiance is a collective of 13 BIPOC fine jewelry designers from around the world who have created capsule jewelry collections featuring diamonds with the De Beers Code of Origin.

Join me for the trunk show this Thursday 12/15 at 6PM @neimanmarcus Roosevelt field and meet the designers or stop by anytime through Sunday. See you there xx

@klgjewellery @by_couture @debeersgroup @neimanmarcus

@rkjewelsnewjersey are exquisite pieces of luxury jewels that can elevate one outfit. When it comes to styling these precious gems, there are several approaches you can take; For a classic and timeless look, pair a Polki diamond choker & necklace with a matching pair of earrings. If you prefer a more classic and statement-making style, opt for a Chakri diamond choker and necklace with the matching earrings, rings & bracelet. Lastly and more traditionally I chose the Kundan Matha Patti and Kundar set. This mix-and-match approach allows you to experiment with different lengths and textures. With these three different sets from @rkjewelsnewjersey diamonds, you can effortlessly transform a single outfit into three distinct and fabulous ensembles, ensuring you always shine bright. 
Suit @safaaworldofficial 

